function vvv() {
    var video = document.getElementById('video');
    var hls = new Hls();
    if (Hls.isSupported()) {
        hls.loadSource('http://192.168.0.171:8080/hls/test.m3u8');
        hls.attachMedia(video);
        hls.on(Hls.Events.MANIFEST_PARSED, function () { video.play(); });
    }
}
